import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
  background-color: grey;
  border-radius: 1rem;
  width: 50%;
  color: darkgrey;
  box-shadow: 0.2rem 0.2rem 0.2rem 0.2rem black;
`;
let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  max-width: 1300px;
  margin: auto;
  background: #00457e;
  padding: 1rem;
`;

let Navbars = styled.div`
  text-align: center;
  background: #02315e;
  color: white;
  padding: 1rem;
  font-size: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let Searchbox = styled.div`
  text-align: center;
  background: #806491;
  color: white;
  padding: 0.5rem;
  border-radius: 1rem;
  margin: 1rem;
  font-size: 1.5rem;
  border: none;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 50rem;
  margin: auto;
  margin-top: 2rem;
  margin-bottom: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let LoginBtn = styled.button`
  text-align: center;
  color: white;
  border-radius: 1rem;
  padding: 0.5rem;
  background: #2f70af;
  float: right;
  font-size: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let Feeds = styled.div`
  border-radius: 1rem;
  background: #02315e;
  color: white;
  padding: 0.5rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let Contents = styled.div`
  background: #00457e;
  margin: 2rem;
  border-radius: 1rem;
  padding: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let PlayerBox = styled.div`
  border-radius: 1rem;
  background: #02315e;
  color: white;
  padding: 0.5rem;
  margin-top: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let ContollerBtn = styled.button`
  border-radius: 10rem;
  background: #2f70af;
`;

function App() {
  return (
    <MainWrap className="App">
      <Navbars>
        SNS Music<LoginBtn>로그인</LoginBtn>
      </Navbars>

      <CenterBox>
        <Searchbox>#검색</Searchbox>
      </CenterBox>
      <Feeds>
        <Contents>내용물</Contents>
        <Contents>내용물</Contents>
      </Feeds>
      <PlayerBox>
        <ContollerBtn> ◁◁ </ContollerBtn>
        <ContollerBtn> ▶ </ContollerBtn>
        <ContollerBtn> ▷▷ </ContollerBtn>
      </PlayerBox>
    </MainWrap>
  );
}

export default App;
